VALUES (47, 'code', 'Multiple Resources:   * [FamilyMemberHistory](familymemberhistory.html): A search by a condition code * [DeviceRequest](devicerequest.html): Code for what is being requested/ordered * [AllergyIntolerance](allergyintolerance.html): Code that identifies the allergy or intolerance * [Procedure](procedure.html): A code to identify a  procedure * [List](list.html): What the purpose of this list is * [ProcedureRequest](procedurerequest.html): What is being requested/ordered * [Observation](observation.html): The code of the observation type * [DiagnosticReport](diagnosticreport.html): The code for the report as a whole, as opposed to codes for the atomic results, which are the names on the observation resource referred to from the result * [Condition](condition.html): Code for the condition', 'http://hl7.org/fhir/SearchParameter/clinical-code', 'FamilyMemberHistory.condition.code | DeviceRequest.code.as(CodeableConcept) | AllergyIntolerance.code | AllergyIntolerance.reaction.substance | Procedure.code | List.code | ProcedureRequest.code | Observation.code | DiagnosticReport.code | Condition.code', 3, 3, TIMESTAMP '2020-03-17 09:58:41.873', TIMESTAMP '2020-03-17 09:58:41.873');

