INSERT INTO "SearchParameter" (id, name, description, url, fhir_path, fk_fhirversion_id, fk_searchparamtype_id, created, updated )
VALUES (1273, 'date', 'Multiple Resources:   * [AllergyIntolerance](allergyintolerance.html): Date first version of the resource instance was recorded * [CarePlan](careplan.html): Time period plan covers * [CareTeam](careteam.html): Time period team covers * [ClinicalImpression](clinicalimpression.html): When the assessment was documented * [Composition](composition.html): Composition editing time * [Consent](consent.html): When this Consent was created or indexed * [DiagnosticReport](diagnosticreport.html): The clinically relevant time of the report * [Encounter](encounter.html): A date within the period the Encounter lasted * [EpisodeOfCare](episodeofcare.html): The provided date search value falls within the episode of care''s period * [FamilyMemberHistory](familymemberhistory.html): When history was recorded or last updated * [Flag](flag.html): Time period when flag is active * [Immunization](immunization.html): Vaccination  (non)-Administration Date * [List](list.html): When the list was prepared * [Observation](observation.html): Obtained date/time. If the obtained element is a period, a date that falls in the period * [Procedure](procedure.html): When the procedure was performed * [RiskAssessment](riskassessment.html): When was assessment made? * [SupplyRequest](supplyrequest.html): When the request was made', 'http://hl7.org/fhir/SearchParameter/clinical-date', 'AllergyIntolerance.recordedDate | CarePlan.period | CareTeam.period | ClinicalImpression.date | Composition.date | Consent.dateTime | DiagnosticReport.effective | Encounter.period | EpisodeOfCare.period | FamilyMemberHistory.date | Flag.period | Immunization.occurrence | List.date | Observation.effective | Procedure.performed | (RiskAssessment.occurrence as dateTime) | SupplyRequest.authoredOn', 4, 1, TIMESTAMP '2020-03-17 09:58:41.873', TIMESTAMP '2020-03-17 09:58:41.873');

